    static void Main()
    {
        int INDEX = int.Parse(Console.ReadLine());
        int N     = int.Parse(Console.ReadLine());

        var sb = new StringBuilder(N);
        for (int k = 0; k < N; k++)
        {
            int pos = INDEX + k;
            int code = P4[pos / 4];
            int slot = pos % 4;
            int digit;
            switch (slot)
            {
                case 0: digit = code / 1000;        break;
                case 1: digit = (code / 100) % 10;  break;
                case 2: digit = (code / 10)  % 10;  break;
                default: digit = code % 10;         break;
            }
            sb.Append((char)('0' + digit));
        }

        Console.WriteLine(sb);
    }
